import './App.css';
import PastEventSection from "./PastEventSection";
import ProjectSection from './ProjectSection';

function App() {
  return (
    <div>
      <h1 className="text-center">Regional Office</h1>
      <h3>Past Events</h3>
      <PastEventSection/>
      <h3>On Going Events</h3>
      <PastEventSection/>
      <h3>Future Events</h3>
      <PastEventSection/>
      <ProjectSection/>
    </div>
  );
}

export default App;
